features.script:
const video1_URL = 'https://www.youtube.com/watch?v=ZPP4EfHVYP8';
const video2_URL = 'https://www.youtube.com/watch?v=V1REd_VqKhM';
const video3_URL = 'https://www.youtube.com/watch?v=qHpBDY7Sz98';
const video4_URL = 'https://www.youtube.com/watch?v=8MN-O1ytkGk';
const video5_URL = 'https://www.youtube.com/watch?v=IdNuEtxlsWE';
const video6_URL = 'https://www.youtube.com/watch?v=t_dcpAsUNaA';
const video7_URL = 'https://www.youtube.com/watch?v=CKygrdRfuI8';
const video8_URL = 'https://www.youtube.com/watch?v=y5bbNt8S2qU';

const videos = [
    [video1_URL, '', 29000],
    [video2_URL, '', 37000],
    [video3_URL, '', 20000],
    [video4_URL, '', 27000],
    [video5_URL, '', 23000],
    [video6_URL, '', 42000],
    [video7_URL, '', 28000],
    [video8_URL, '', 24000],
];

let play = false;
let index = 0;
var timeOut;

InitFeatureEvents();

function InitFeatureEvents()
{
    try
    {
        let playFeature = parcel.getFeatureById('laptopPlay');
        playFeature.on('click', (e)=> { 
            play = true;
            playVideo(true);
        });
        let pauseFeature = parcel.getFeatureById('laptopPause');
        pauseFeature.on('click', (e)=> { 
            stopVideo(); 
        });
    }
    catch(e)
    {
        console.log(`exception on InitFeatureEvents(); exception: ${e}`);
    }    
};

function playVideo(manualPlay) {
    try
    {
        if (!play) return;

        console.log(timeOut);
        //if (timeOut != undefined) clearTimeout(timeOut);

        if (index >= videos.length) 
        {
            index = 0;
            if (!manualPlay)
            {
                stopVideo();
                return;
            }
        }

        setVideoToPlay(videos[index][0], videos[index][1]);
        timeOut = setTimeout(()=>{
                playVideo(false);
        }, videos[index][2]);
        index += 1;
    }
    catch(e)
    {
        console.log(`Error - playVideo(); exception: ${e}`);
    }
};

function setVideoToPlay(videoUrl, previewUrl)
{
    try
    {
        let projector = parcel.getFeatureById('projector');
        projector.set({'url': videoUrl });
        //projector.set({'previewUrl': previewUrl});
        projector.play();
        //console.log(projector);
    }
    catch(e)
    {
        console.log(`Error - setVideoToPlay(); videoUrl: ${videoUrl}; previewUrl: ${previewUrl}; exception: ${e}`);
    }
};

function stopVideo() {
    try
    {
        console.log(timeOut);
        //clearTimeout(timeOut);
        play = false;
        let projector = parcel.getFeatureById('projector');
        projector.pause();
    }
    catch(e)
    {
        console.log(`Error - stopVideo(); exception: ${e}`);
    }
};
